import React, { useEffect, useState } from 'react';
import '../styles/dashboard.css';
import api from '../services/api';

const DashboardAdmin = () => {
  const [stats, setStats] = useState({
    totalUsers: 0,
    totalClasses: 0,
    totalMaterials: 0,
    totalAssignments: 0,
  });
  const [userStats, setUserStats] = useState([]);
  const [recentUsers, setRecentUsers] = useState([]);

  useEffect(() => {
    // Fetch system statistics from backend API
    const fetchStats = async () => {
      try {
        const resUsers = await api.get('/admin/dashboard/users-count');
        const resClasses = await api.get('/classes/count');
        const resMaterials = await api.get('/materials/count');
        const resAssignments = await api.get('/assignments/count');

        setStats({
          totalUsers: resUsers.data.total,
          totalClasses: resClasses.data.count,
          totalMaterials: resMaterials.data.count,
          totalAssignments: resAssignments.data.count,
        });
      } catch (error) {
        console.error('Failed to fetch system statistics:', error);
      }
    };

    // Fetch user statistics by role
    const fetchUserStats = async () => {
      try {
        const res = await api.get('/admin/dashboard/user-stats');
        setUserStats(res.data);
      } catch (error) {
        console.error('Failed to fetch user statistics:', error);
      }
    };

    // Fetch recent users
    const fetchRecentUsers = async () => {
      try {
        const res = await api.get('/admin/dashboard/recent-users');
        setRecentUsers(res.data);
      } catch (error) {
        console.error('Failed to fetch recent users:', error);
      }
    };

    fetchStats();
    fetchUserStats();
    fetchRecentUsers();
  }, []);

  return (
    <div className="dashboard-container">
      <h2>Dashboard Admin</h2>
      <p>Selamat datang di panel administrasi e-learning SMA</p>

      <div className="dashboard-grid">
        <div className="dashboard-card">
          <h3>Statistik Sistem</h3>
          <div className="stats-grid">
            <div className="stat-item">
              <div className="stat-value">{stats.totalUsers}</div>
              <div className="stat-label">Total Pengguna</div>
            </div>
            <div className="stat-item">
              <div className="stat-value">{stats.totalClasses}</div>
              <div className="stat-label">Total Kelas</div>
            </div>
            <div className="stat-item">
              <div className="stat-value">{stats.totalMaterials}</div>
              <div className="stat-label">Total Materi</div>
            </div>
            <div className="stat-item">
              <div className="stat-value">{stats.totalAssignments}</div>
              <div className="stat-label">Total Tugas</div>
            </div>
          </div>
        </div>

        <div className="dashboard-card">
          <h3>Statistik Pengguna</h3>
          <ul className="user-stats-list">
            {userStats.map((stat) => (
              <li key={stat.role}>
                <span className="role-label">{stat.role.charAt(0).toUpperCase() + stat.role.slice(1)}</span>
                <span className="role-count">{stat.count}</span>
              </li>
            ))}
          </ul>
        </div>

        <div className="dashboard-card">
          <h3>Pengguna Terbaru</h3>
          <ul className="recent-users-list">
            {recentUsers.map((user) => (
              <li key={user.id} className="recent-user-item">
                <strong>{user.nama_lengkap}</strong>
                <div>Username: {user.username}</div>
                <div>Role: {user.role}</div>
                <div>Dibuat: {new Date(user.created_at).toLocaleDateString()}</div>
              </li>
            ))}
          </ul>
        </div>
      </div>
    </div>
  );
};

export default DashboardAdmin;
